            <h2> Minion richkid</h2>
            <p>Minion niềng răng, chạy xe Vision</p>
        </div>
    );

}
function PostItem(src, title, des){
    return(
        <div className="post-item">
            <img src={src} alt="minions"></img>
            <h2> {title}</h2>
            <p>{des}</p>
        </div>
    );

}
export default PostItem;
